INSERT INTO `notification` (`id`, `sms_id`, `sms_text`) VALUES
(1, 'SMSA01', 'Hi #{DNM}#, the early bird catches the worm. We encourage you to declare your sales early so that you can have enough time and room to work freely.Please log into www.driver-sales.fleetopsgh.com and remember to input the vehicle number in the correct format (i.e., without signs and symbols, or punctuation marks) and use the phone number that has your active mobile money account for cash payment. Counting on your cooperation. Thanks.'),
(2, 'SMSA02', 'Hi #{DNM}#, your work is much appreciated by your car owner and sales declaration form an important part of this function. Please declare your sales. Please log into www.driver-sales.fleetopsgh.com and remember to input the vehicle number in the correct format (i.e., without signs and symbols, or punctuation marks) and use the phone number that has your active mobile money account for cash payment. Counting on your cooperation. Thanks.'),
(3, 'SMSA03', 'Hi #{DNM}#, we have sent two reminders so far, but have still not received a reaction from you. To avoid any inconveniences please declare your sales now!. Please log into www.driver-sales.fleetopsgh.com and remember to input the vehicle number in the correct format (i.e., without signs and symbols, or punctuation marks) and use the phone number that has your active mobile money account for cash payment. Counting on your cooperation. Thanks.'),
(4, 'SMSA04', '#{DNM}#, per agreement with your car owner we have been compelled to take the necessary actions to ensure you declare sales and submit cash collected to date. Your car owner has been notified and has been advised to take the necessary actions with you. Declare your sales immediately to continue working. Please log into www.driver-sales.fleetopsgh.com and remember to input the vehicle number in the correct format (i.e., without signs and symbols, or punctuation marks) and use the phone number that has your active mobile money account for cash payment. Counting on your cooperation. Thanks.'),
(5, 'SMSA05', 'Hi #{CZN}#, we wish to bring to your attention that your driver #{DNM}# using vehicle number #{VNO}# has failed to declare sales for work done as stated in your agreement with him/her. We have activated our enforcement mechanisms to compel your driver to declare sales and submit cash collected. We advice that you contact him/her to comply else please take the necessary actions to safeguard your vehicle from abuse and inappropriate use. Thank you.'),
(6, 'SMSB06', 'Message Sent by Cash collection service provider.'),
(7, 'SMSB07', 'Hi, an amount of #{RMT}# has been received by FleetOps & Vantage. Your car owner will be notified accordingly. Thank you.'),
(8, 'SMSC08', 'Hi #{CZN}#, upon our investigation, we wish to bring to your attention that your driver #{DNM}# using vehicle number #{VNO}# has failed to fully declare sales for work done as per your agreement with him/her. If this persists, we shall activate our enforcement mechanisms to compel your driver to render sales fully. We however entreat you to contact your driver to comply else please take the necessary actions to safeguard your vehicle from abuse and inappropriate use. Thank you.'),
(9, 'SMSD09', 'Hi, please be informed that upon declaration of sales, your driver #{DNM}# using vehicle number #{VNO}# has consumed #{FTP}# amount of fuel and has incurred #{CWI}# of waste; this amount is potential revenue lost due to the use of your car for whatever reason other than generate revenue.'),
(10, 'SMSD10', 'Hi, please be informed that upon declaration of sales, you have consumed #{FTP}# amount of fuel and have incurred #{CWI}# of waste; this amount is potential revenue lost due to the use of the car for whatever reason other than generate revenue. We entreat you to minimize losses by using the car for revenue generation purposes only as agreed with the car owner.'),
(11, 'SMSE11', 'Hi, please be informed that your driver #{DNM}# using vehicle number #{VNO}# has stated that he is unable to retrieve sales data from his phone. Accordingly, we have taken steps to investigate the issue and have managed to derive the amount of #{CWI}# due for payment. Also, the driver consumed #{FTP}# amount of fuel. Thank you.');
